import React from 'react';
import './card.scss';

const Card = (props) => {
    return ( <div className="card">
        <div className="card-side card-side-front">
            <img alt='robots' src={`https://robohash.org/${1}?1110x1110`} />
            <div className="card-side-front-content">
                <div className="card-side-front-content-h">dfsdfsdf</div>
                <div className="card-side-front-content-t">sdfasd</div>
            </div>
        </div>
        <div className="card-side card-side-back">
        </div>
    </div> );
}

export default Card;
